Write a Python program that takes a space-separated sequence of integers as input from the user, calculates the sum of even numbers, and stops when a negative number is encountered. Once a negative number is entered, the program should print the sum of all even numbers entered before it.<br />
&nbsp;
<p>&nbsp;</p>

You&#39;re developing a program to help a user manage their expenses for a trip. The user wants to keep track of their daily expenses and calculate the total expenditure for the entire trip. Create a Python program that takes the number of days for the trip as input and then asks the user to input the daily expenses for each day using a loop. Finally, the program should calculate and display the total expenses for the trip.<br />
<br />
&nbsp;

Create a&nbsp;<strong>Bus</strong>&nbsp;child class that inherits from the Vehicle class. The default fare charge of any vehicle is&nbsp;<strong>seating capacity * 100</strong>. If the Vehicle is a&nbsp;<strong>Bus</strong>&nbsp;instance, we need to add an extra 10% on the full fare as a maintenance charge. So the total fare for the bus instance will become the&nbsp;<strong>final amount = total fare + 10% of the total fare.<br />
Note:</strong> The bus seating capacity is&nbsp;<strong>50</strong>. so the final fare amount should be<strong>&nbsp;5500. &nbsp;</strong>You need to override the&nbsp;<code>fare()</code>&nbsp;method of a Vehicle class in the Bus class.<br />
&nbsp;

You are developing a Python program to generate personalized greeting card messages. While attempting to include a quote by Albert Einstein in the greeting message, you encountered an error due to double quotes within the text. Your task is to fix the code by using escape characters to include the quote by Albert Einstein without causing an error. Additionally, the greeting card message includes the sender and recipient&#39;s names (&quot;The greeting is from Alice to Kimberly&quot;) but lacks proper formatting. Modify the code to incorporate escape characters to display the quote and greeting message correctly.<br />
<br />
&nbsp;

Write a program that takes in a string and prints a new string with the words reversed.<br />
<br />
<b>Note:</b> You might need to use <code>join()</code> here. In Python, the join() method is used to concatenate elements of an iterable, such as a list, with a specified separator and returns a string. <code>string_separator.join(iterable)</code>&nbsp;
